Accounts_CustomFields_Description:
Turėtų būti galiojanti JSON, kur klavišai yra laukų pavadinimai, kuriuose yra lauko nustatymų žodynas. Pavyzdys:<br/><code>{
"vaidmuo": {
"tipas": "pasirinkite",
"defaultValue": "studentas"
"Pasirinktys": ["mokytojas", "studentas"],
"reikalingas": tiesa
"modifyRecordField": {
"masyvas": tiesa
"laukas": "vaidmenys"
}
},
"twitter": {
"tipas": "tekstas",
"reikalingas": tiesa
"minLength": 2,
"maxLength": 10
}
}</code>

Custom_Translations_Description:
Turėtų būti galiojanti JSON, kur raktai yra kalbos, kuriose yra raktinių žodžių ir vertimų žodynas. Pavyzdys: <br/><code>{
"en": {
"Kanalai": "Kambariai"
},
"pt": {
"Kanalai": "salos"
}
}</code>
